d">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>鲍德温与海耶克将在片中饰演一对夫妻，在送归女儿返校后，两人的午夜畅饮，却引发了一起充斥着搞笑情节的绑架事件</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/53024/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/4776/" data-original="http://pic.iqiyi6123.com/upload/vod/2018-04-28/201804281524880645.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/4776/">情醉金迷</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E5%B0%8F%E8%88%9F------------/" target="_blank">李小舟</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9C%B1%E5%86%9B--------/" target="_blank">朱军</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/7/" target="_blank">喜剧片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2017/" target="_blank">2017</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>故事围绕着主人翁周大的生活展开，他虽家道败破，仆从“迷糊”却对他不离不弃，两人相依为命，艰难度日后来，周大爱上了在镇上开茶馆的莲花，仆人“迷糊”为其殷勤说和，却未被拜金的莲花看好，因为周大此时已家徒四壁，食无隔夜之粮，为此，周大挖空心思做起了要钱不要脸的买卖，寻卜觅卦求神问路，拉房客典祖业，只要可以</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/4776/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/23409/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2018-01-25/201801251516867439.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">7.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD1280高清国语中字版</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/23409/">醉有应得</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E5%8F%8C%E5%96%9C------------/" target="_blank">李双喜</a>&nbsp;<a href="/s/-%E8%8B%97%E5%AE%AA%E5%BD%AC------------/" target="_blank">苗宪彬</a>&nbsp;<a href="/s/-%E6%A2%81%E6%99%93%E8%89%BE------------/" target="_blank">梁晓艾</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E8%8B%97%E5%AE%AA%E5%BD%AC--------/" target="_blank">苗宪彬</a>&nbsp;<a href="/s/-----%E9%83%AD%E5%9D%9A--------/" target="_blank">郭坚</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2018/" target="_blank">2018</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>本剧以三山市的失踪断指案展开，围绕着杨伟对茉莉的虐恋；强子、王琦以及吴彬之间的三角关系；女大学生的裸贷疑云；面对无处不在的第三只眼，他们能否逃脱法律的制裁？而面对爱情、仇恨、欲望、金钱的他们，又能否逃脱命运的安排？本剧三个故事环环相扣，逐步展开，而真相究竟又是什么呢...？</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/23409/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/63689/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-01-11/201901111547198851.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">3.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/63689/">致命宿醉</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E4%B9%94%E6%B6%B5------------/" target="_blank">乔涵</a>&nbsp;<a href="/s/-%E6%9B%B9%E5%87%AF------------/" target="_blank">曹凯</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E9%99%88%E5%BA%B7%E5%A4%AA--------/" target="_blank">陈康太</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：<